import React from 'react';

function Nav() {
    return (
       <div>
           <h1>John Nguyen</h1>
           <ul>
               <li>About</li>
               <li>Contact</li>
               <li>Projects</li>
           </ul>
       </div>
    )
}

export default Nav;
